/*Table structure for table `feedback` */

DROP TABLE IF EXISTS `feedback`;

CREATE TABLE `feedback` (
  `id` int(10) NOT NULL AUTO_INCREMENT,
  `way` int(10) DEFAULT NULL COMMENT '反馈方式[1实名 2匿名]',
  `type` int(10) DEFAULT NULL COMMENT '反馈类型[1工资 2保险 3其他 ]',
  `time` bigint(30) DEFAULT NULL COMMENT '反馈时间',
  `person_id` int(10) DEFAULT NULL COMMENT '反馈人员id(匿名投诉无值)',
  `content` text COMMENT '反馈详情内容',
  `pics` text COMMENT '图片证明,逗号分割多个图片',
  `deal_person_id` int(10) DEFAULT NULL COMMENT '处理人id',
  `deal_time` bigint(30) DEFAULT NULL COMMENT '处理时间',
  `deal_status` int(10) DEFAULT NULL COMMENT '处理状态[1收到 2 处理中 3处理完毕 ]',
  `deal_say` text COMMENT '处理结果及建议',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `feedback` */

/*Table structure for table `insurance_company` */

DROP TABLE IF EXISTS `insurance_company`;

CREATE TABLE `insurance_company` (
  `id` int(50) NOT NULL AUTO_INCREMENT COMMENT '保险公司id',
  `name` varchar(100) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '保险公司名称',
  `url_for_query` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '保险公司查询保单号地址',
  `url_index` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '保险公司官网',
  `phone` varchar(100) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '保险公司电话',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=11 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

