/*Table structure for table `person_salary` */

DROP TABLE IF EXISTS `person_salary`;

CREATE TABLE `person_salary` (
  `id` int(10) NOT NULL AUTO_INCREMENT,
  `fee_type` varchar(20) DEFAULT NULL COMMENT '费用类别[生活费 工程款]',
  `person_name` varchar(100) DEFAULT NULL COMMENT '人员姓名',
  `person_num` varchar(50) DEFAULT NULL COMMENT 'identity_num 人员身份证',
  `send_time` varchar(100) DEFAULT NULL COMMENT '生活费',
  `send_much` varchar(100) DEFAULT NULL COMMENT '工资',
  `zheng_ju_urls` text COMMENT '薪资发放证明文件地址',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=77 DEFAULT CHARSET=utf8;

